<!DOCTYPE html>
<html lang="de">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Geschmeidigkeit Legacy</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Courier New', monospace;
            background: #000;
            overflow: hidden;
            height: 100vh;
            position: relative;
        }

        /* Background Image Layer - Always visible at the back */
        .background-image {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: 1;
            display: flex;
            align-items: center;
            justify-content: center;
            background: #000;
        }

        .background-image img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            animation: colorCycle 6s ease-in-out infinite;
        }

        @keyframes colorCycle {
            0% {
                filter: grayscale(100%) brightness(1.1);
            }
            25% {
                filter: grayscale(100%) brightness(1.1);
            }
            26% {
                filter: grayscale(0%) brightness(1) hue-rotate(260deg) saturate(200%);
            }
            50% {
                filter: grayscale(0%) brightness(1.2) hue-rotate(260deg) saturate(250%) contrast(1.2);
            }
            75% {
                filter: grayscale(0%) brightness(1) hue-rotate(260deg) saturate(200%);
            }
            76% {
                filter: grayscale(100%) brightness(1.1);
            }
            100% {
                filter: grayscale(100%) brightness(1.1);
            }
        }

        /* Matrix Rain Canvas - In front of image */
        #matrixCanvas {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: 2;
            opacity: 0.85;
        }

        /* Main Content Container - On top of everything */
        .content-wrapper {
            position: relative;
            z-index: 3;
            width: 100%;
            height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 20px;
            pointer-events: none;
        }

        /* Title */
        .title {
            font-size: 4rem;
            font-weight: bold;
            text-transform: uppercase;
            letter-spacing: 8px;
            background: linear-gradient(45deg, #b721ff, #6b00ff, #ff00ff);
            background-size: 200% 200%;
            -webkit-background-clip: text;
            background-clip: text;
            -webkit-text-fill-color: transparent;
            animation: gradientShift 3s ease infinite, textGlow 2s ease-in-out infinite;
            filter: drop-shadow(0 0 20px rgba(183, 33, 255, 0.8)) drop-shadow(0 0 40px rgba(183, 33, 255, 0.6));
            text-align: center;
        }

        @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }

        @keyframes textGlow {
            0%, 100% { 
                filter: drop-shadow(0 0 20px rgba(183, 33, 255, 0.8)) drop-shadow(0 0 40px rgba(183, 33, 255, 0.6));
                transform: scale(1);
            }
            50% { 
                filter: drop-shadow(0 0 40px rgba(183, 33, 255, 1)) drop-shadow(0 0 80px rgba(183, 33, 255, 0.9));
                transform: scale(1.05);
            }
        }

        /* Matrix character transformation */
        @keyframes matrixGlitch {
            0%, 85% {
                opacity: 1;
            }
            86%, 88% {
                opacity: 0.3;
                text-shadow: 
                    2px 2px 0 #b721ff,
                    -2px -2px 0 #6b00ff,
                    0 0 20px rgba(183, 33, 255, 1);
            }
            89%, 91% {
                opacity: 0.7;
            }
            92%, 100% {
                opacity: 1;
            }
        }

        .title {
            animation: gradientShift 3s ease infinite, textGlow 2s ease-in-out infinite, matrixGlitch 8s ease-in-out infinite;
        }



        /* Scanline overlay */
        .scanlines {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: 5;
            pointer-events: none;
            background: linear-gradient(
                transparent 50%,
                rgba(183, 33, 255, 0.05) 50%
            );
            background-size: 100% 4px;
            animation: scanlines 8s linear infinite;
        }

        @keyframes scanlines {
            0% { background-position: 0 0; }
            100% { background-position: 0 100%; }
        }

        /* Responsive adjustments */
        @media (max-width: 768px) {
            .title {
                font-size: 2.5rem;
                letter-spacing: 4px;
            }
        }

        @media (max-width: 480px) {
            .title {
                font-size: 1.8rem;
                letter-spacing: 2px;
            }
        }
    </style>
</head>

    <!-- Matrix Rain Canvas - Layer 2 (middle) -->
    <canvas id="matrixCanvas"></canvas>

    <!-- Content Overlay - Layer 3 (top) -->
    <div class="content-wrapper">
        <h1 class="title" id="mainTitle">Geschmeidigkeit Legacy</h1>
    </div>

    <!-- Scanlines Effect - Layer 5 (very top) -->
    <div class="scanlines"></div>

    <script>
        // Matrix Rain Effect
        const canvas = document.getElementById('matrixCanvas');
        const ctx = canvas.getContext('2d');

        // Set canvas size
        function resizeCanvas() {
            canvas.width = window.innerWidth;
            canvas.height = window.innerHeight;
        }
        resizeCanvas();
        window.addEventListener('resize', resizeCanvas);

        // Matrix characters (using various Unicode characters)
        const matrixChars = 'アイウエオカキクケコサシスセソタチツテトナニヌネノハヒフヘホマミムメモヤユヨラリルレロワヲンABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789@#$%^&*()';
        const chars = matrixChars.split('');

        const fontSize = 16;
        const columns = canvas.width / fontSize;
        const drops = [];

        // Initialize drops
        for (let i = 0; i < columns; i++) {
            drops[i] = Math.random() * -100;
        }

        // Draw matrix rain
        function drawMatrix() {
            // Semi-transparent black to create trail effect
            ctx.fillStyle = 'rgba(0, 0, 0, 0.05)';
            ctx.fillRect(0, 0, canvas.width, canvas.height);

            // Set text style
            ctx.font = fontSize + 'px monospace';

            for (let i = 0; i < drops.length; i++) {
                // Random character
                const char = chars[Math.floor(Math.random() * chars.length)];
                
                // Create gradient for purple glow effect
                const gradient = ctx.createLinearGradient(
                    i * fontSize, drops[i] * fontSize - 20,
                    i * fontSize, drops[i] * fontSize + 20
                );
                
                gradient.addColorStop(0, 'rgba(183, 33, 255, 0.2)');
                gradient.addColorStop(0.5, 'rgba(183, 33, 255, 1)');
                gradient.addColorStop(1, 'rgba(107, 0, 255, 0.5)');
                
                ctx.fillStyle = gradient;
                
                // Add glow effect
                ctx.shadowBlur = 15;
                ctx.shadowColor = '#b721ff';
                
                // Draw character
                ctx.fillText(char, i * fontSize, drops[i] * fontSize);

                // Reset drops
                if (drops[i] * fontSize > canvas.height && Math.random() > 0.975) {
                    drops[i] = 0;
                }

                // Move drop down
                drops[i]++;
            }
        }

        // Animation loop
        setInterval(drawMatrix, 50);

        // Add extra glowing matrix characters that fall faster occasionally
        function addFastDrop() {
            const col = Math.floor(Math.random() * columns);
            drops[col] = -50;
        }

        setInterval(addFastDrop, 200);

        // Matrix text transformation effect
        const titleElement = document.getElementById('mainTitle');
        const originalText = 'Geschmeidigkeit Legacy';
        const matrixCharsForTitle = 'アイウエオカキクケコサシスセソタチツテトナニヌネノハヒフヘホマミムメモヤユヨラリルレロワヲン';

        function transformToMatrix() {
            let currentText = titleElement.textContent;
            let transformedText = '';
            
            for (let i = 0; i < currentText.length; i++) {
                if (currentText[i] === ' ') {
                    transformedText += ' ';
                } else {
                    // Random chance to transform each character
                    if (Math.random() > 0.3) {
                        transformedText += matrixCharsForTitle[Math.floor(Math.random() * matrixCharsForTitle.length)];
                    } else {
                        transformedText += currentText[i];
                    }
                }
            }
            
            titleElement.textContent = transformedText;
        }

        function glitchTitle() {
            // Transform to matrix characters
            transformToMatrix();
            
            // Transform multiple times for glitch effect
            setTimeout(transformToMatrix, 50);
            setTimeout(transformToMatrix, 100);
            setTimeout(transformToMatrix, 150);
            
            // Restore original text
            setTimeout(() => {
                titleElement.textContent = originalText;
            }, 400);
        }

        // Trigger glitch every 8 seconds (matching the animation)
        setInterval(glitchTitle, 8000);
    </script>
